import React, { useState } from "react";
import "../styles/Login.css";
import Logo from "../assets/logo light.jpg";

function Login({ setAuth }) {
  const [showCard2, setShowCard2] = useState(false);
  const [role, setRole] = useState("patient");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  const handleLoginClick = () => {
    setShowCard2(true);
    setErrorMessage("");
  };

  const handleNextClick = async () => {
    let url = "";
    let body = {};

    if (role === "admin") {
      url = "http://localhost:8080/auth/admin/login";
      body = {
        adminId: username,
        password: password,
      };
    } else if (role === "doctor") {
      url = "http://localhost:8080/auth/doctor/login";
      body = {
        email: username,
        password: password,
      };
    } else if (role === "patient") {
      url = "http://localhost:8080/auth/patient/login";
      body = {
        phone: username,
        password: password,
      };
    }

    try {
      const response = await fetch(url, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(body),
      });

      if (!response.ok) {
        const errorData = await response.json();
        console.error("Server responded with error:", errorData);
        const message =
          errorData.message || "Server error. Please try again later.";
        throw new Error(message);
      }

      const data = await response.json();

      localStorage.setItem("token", data.token);
      localStorage.setItem("role", role);

      console.log("Login successful. Token:", data.token);
      console.log("Role set as:", role);

      setAuth({
        isAuthenticated: true,
        role: role.toUpperCase(), // Convert to "ADMIN", "DOCTOR", "PATIENT"
        username: data.name || username, // Use backend name or input if not returned
      });
    } catch (error) {
      console.error("Login error:", error);
      setErrorMessage(error.message);
    }
  };

  return (
    <div className="Login-Cards">
      <div
        className={`card-transition ${showCard2 ? "card-hide" : "card-show"}`}
      >
        <div className="Login-card-1">
          <img src={Logo} alt="" />
          <h2>Login to Medical Notes</h2>
          <p>Access Your Account securely.</p>
          <button className="btn btn-primary" onClick={handleLoginClick}>
            Login
          </button>
        </div>
      </div>

      <div
        className={`card-transition ${showCard2 ? "card-show" : "card-hide"}`}
      >
        <div className="login-container Login-card-2">
          <img src={Logo} alt="" className="logo" />
          <h2>Sign in to MedicNotes</h2>
          <p className="subtitle">Access your Account securely</p>

          <label htmlFor="role">I am a</label>
          <select
            id="role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
          >
            <option value="patient">Patient</option>
            <option value="doctor">Doctor</option>
            <option value="admin">Admin</option>
          </select>

          <label htmlFor="email">Username / Email / ID</label>
          <input
            type="text"
            id="email"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="e.g., dr.john@example.com"
          />

          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="password"
          />

          {errorMessage && <div className="error-message">{errorMessage}</div>}

          <button className="btn" onClick={handleNextClick}>
            Next
          </button>
        </div>
      </div>
    </div>
  );
}

export default Login;
